Ad Text:
Help lead the transition to a zero-carbon future.

This is a unique opportunity for an experienced Senior FP&A Manager to play a critical role in Australia’s energy transformation. Join a purpose-driven organisation committed to accelerating the shift to renewable energy, backed by a community of forward-thinking government, industry and commercial partners.

If you’re passionate about making an impact, thrive in a collaborative environment, and want your work to contribute directly to Australia’s clean-energy future, this role offers the platform to do exactly that.

About the Role

Reporting to the CFO, you will shape the organisation’s financial planning, performance insights and long-term forecasting. You’ll lead budgeting, strategic planning and monthly forecasting cycles, providing timely, data-driven analysis that directly supports commercial decisions, operational efficiency and future growth.

This role is both strategic and hands-on, working closely with teams across customer operations, trading, asset development, risk and IT to deliver high-quality financial insights and drive business performance.

Key Responsibilities

Lead annual budgeting cycles, delivering the 1-year operational plan and 3-year strategic plan;
Develop and refine KPIs that measure business performance and link directly to P&L outcomes;
Drive monthly forecasting cycles, ensuring accuracy, clarity and alignment across the business;
Build, maintain and continuously improve financial models for forecasting, budgeting and scenario planning;
Analyse monthly and quarterly results, providing insights on variances, trends and performance drivers;
Strengthen data quality, modelling governance and internal controls across all FP&A processes;
Partner with customer, risk and trading teams to optimise pricing strategies and gross margin outcomes;
Collaborate across operations, asset development and IT to improve cost efficiency and resource allocation;
Prepare clear, insightful executive and board-level FP&A reporting;
Support the month-end process and contribute to ongoing improvements in systems and reporting tools; and
Mentor and develop junior analysts within the finance team.
What You Bring

5+ years’ experience in FP&A, ideally within electricity, gas or utilities;
Tertiary qualifications in Finance or Accounting; CFA, CA or CPA preferred;
Strong financial modelling capability and advanced Excel/Power BI skills;
Solid understanding of the retail electricity market and wholesale hedging methodologies;
High attention to detail, strong analytical thinking and commercial acumen;
Excellent communication skills and the ability to influence and partner with stakeholders; and
Self-driven, proactive and comfortable working to deadlines.
Why Join

Contribute directly to Australia’s transition to a zero-emissions future.
Work with a values-driven team that prioritises collaboration, transparency, innovation and wellbeing.
Be part of an organisation committed to diversity, reconciliation and creating an inclusive culture.
Engage with passionate colleagues across finance, trading, operations, technology and sustainability.
If you’re ready to use your financial expertise to help power a cleaner future, we’d love to hear from you. Apply now.

How to Apply

For more information or a confidential discussion please call James Carswell at u&u on 0413 723 383 quoting reference number #43593.

