Business Analyst – Data & Analytics 

Location: Macquarie Park | Hybrid Working 
 
An exciting opportunity exists for a skilled Business Analyst to join a growing Enterprise Data team within a large, well-established organisation. This team is driving a data-first approach, ensuring data, insights and analytics underpin strategic and operational decisions across the business. 

This role is ideal for someone who thrives in a data-driven environment, enjoys working with modern cloud platforms, and can confidently translate business requirements into practical data and BI solutions. 

About the Role 

As the Business Analyst, you will support the delivery of data and analytics initiatives across the enterprise. You will gather and analyse business requirements, shape user stories, support data modelling and data warehouse enhancements, and help drive adoption of BI tools, especially Power BI. 

You’ll work closely with data engineers, product owners and business stakeholders to design and deliver scalable data solutions within an Azure environment. 

Key Responsibilities 

Gather, analyse and document business requirements for BI and data initiatives;
Translate user needs into detailed functional designs, user stories and acceptance criteria;
Support the design, testing and delivery of data warehouse and analytics solutions;
Work with technical teams to ensure alignment with Azure architecture and data standards;
Develop process maps, business glossaries and end-user documentation;
Partner with stakeholders to enhance reporting and visualisation using Power BI;
Facilitate workshops, training sessions, demos and reviews; and
Actively participate in agile ceremonies including stand-ups, sprint planning and retrospectives. 
About You 

3–5 years’ experience as a Business Analyst within BI, analytics or data warehouse environments;
Strong understanding of data warehousing, data modelling, and enterprise DW concepts;
Working knowledge of Azure data services and cloud-based data platforms;
Skilled in SQL, data analysis and working with complex datasets;
Hands-on experience with Power BI (reporting, dashboards, visualisations);
Strong communication and stakeholder engagement skills;
Experience with agile frameworks (Scrum, Kanban, Lean);
Ability to work both independently and collaboratively across cross-functional teams; and
Excellent attention to detail and documentation skills. 
Why You’ll Love This Role 

Shape and influence enterprise-wide data products and analytics capabilities;
Work in a modern data environment with Azure, Power BI and advanced data warehouse solutions;
Hybrid work arrangements in a convenient Macquarie Park location; and
Supportive team, strong culture and opportunities for professional development. 
If you’re passionate about data, BI and driving meaningful insights through Azure and Power BI, we’d love to hear from you. Apply now for a confidential conversation. 

